import React from 'react';
import Home from './website/Home';


const App = () => {
  function setScreenSize() {
    let vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty("--vh", `${vh}px`);
  }
  useEffect(() => {
    setScreenSize();
  });
  return (

    <div>
      <Home/>
    </div>
  );
};

export default App;
